#include <vector>
#include <algorithm>
#include <cmath>

using namespace std;

class Solution {
public:
    static const int MOD = 1e9 + 7;

    int primeScore(int x) {
        int score = 0;
        for (int i = 2; i <= sqrt(x); ++i) {
            if (x % i == 0) {
                ++score;
                while (x % i == 0) x /= i;
            }
        }
        if (x > 1) ++score;
        return score;
    }

    int maximumScore(vector<int>& nums, int k) {
        vector<pair<int, int>> scores;
        for (int i = 0; i < nums.size(); ++i) {
            scores.emplace_back(primeScore(nums[i]), nums[i]);
        }
        sort(scores.rbegin(), scores.rend());

        long long score = 1;
        for (int i = 0; i < min(k, (int)scores.size()); ++i) {
            score = (score * scores[i].second) % MOD;
        }

        return score;
    }
};
